import React, { useState, useContext } from 'react'
import axios from "axios";
import AuthContext from "../contexts/AuthContext.jsx";
import {ReactSearchAutocomplete} from "react-search-autocomplete";
import FancyBar from "./FancyBar";

var activeUser;
var items = [

];

const items1 = [
    {
      id: 0,
      name: "Cobol",
    },
    {
      id: 1,
      name: "JavaScript",
    },
    {
      id: 2,
      name: "Basic",
    },
    {
      id: 3,
      name: "PHP",
    },
    {
      id: 4,
      name: "Java",
    },
  ];


const handleOnSearch = (string, results, auth) => {
    //alert(JSON.stringify(items1));
    axios
        .get("http://localhost:5000/" + activeUser + "/history")
        .then((res) => {
            //alert(JSON.stringify(res.data.history));
            items = res.data.history;
        });
  console.log(string, results);
};

const handleOnHover = (result) => {
  console.log(result);
};

const handleOnSelect = (item) => {
  console.log(item);
};

const handleOnFocus = () => {
  console.log("Focused");
};

const handleOnClear = () => {
  console.log("Cleared");
};

const formatResult = (item) => {
  console.log(item);
  return (
    <div className="result-wrapper">
     <span className="result-span">id: {item.id}</span>
      <span className="result-span">type: {item.type}</span>
      <span className="result-span">request: {item.request}</span>
    </div>
  );
};

const Dashboard = () => {
    const { auth } = useContext(AuthContext);
    const [result, setResult] = useState("");

    activeUser = auth.username;

    return (
        <>
            <FancyBar/>
            <div style={{}}>
                <div style={{ marginTop: "10%", width: "50%", margin:'auto'}}>
                  <ReactSearchAutocomplete
                    items={items}
                    onSearch={handleOnSearch}
                    onHover={handleOnHover}
                    onSelect={handleOnSelect}
                    onFocus={handleOnFocus}
                    onClear={handleOnClear}
                    styling={{


                    }}
                    formatResult={formatResult}
                    autoFocus
                    fuseOptions={{keys: ['request']}}
                  />
              </div>
            </div>
        </>
    );
  }

export default Dashboard;
